webpackJsonp([0xfa322eebdef2],{1275:function(e,a){e.exports={data:{markdownRemark:{html:"<p>Go to Beidaihe today. The train opened for four hours and went to Beidaihe, which was already 11:20 noon. After moving things into the car, drive away directly from the platform. There are tourists on the road like tides. About 20 minutes, I arrived at a wooded place. Under the command of the police, we turned into a road, and soon we arrived at the building where we lived, a small Western-style building.</p>\n<p>Going by the sea, I spent three dollars to buy swimming trunks and a swimming cap. Going for a swim after dinner, swimming for a while, there is a feeling of longing into the vast sea and longing for two poems:</p>\n<p>Swimming wave</p>\n<p>Far from the wind, the rush is near,</p>\n<p>Tao Libo has a long dike and is low.</p>\n<p>The turbid waves are coming to the sea,</p>\n<p>The sandpaper is going to calm down.</p>\n<p>The vulgarity gradually turns into a peak,</p>\n<p>The holy thoughts are in the water.</p>\n<p>Reappearing,</p>\n<p>Seeing that Xiangke is fighting again.</p>\n<p>Swimming in the sea</p>\n<p>The sun is covered,</p>\n<p>Gradually into the vastness of the arrogant.</p>\n<p>Tao Ming flows dark and does not live,</p>\n<p>The wind rushed to the beach.</p>\n<p>Pillow waves look up at the floating clouds,</p>\n<p>Cangbo straight up the mountain.</p>\n<p>There have been vicissitudes of life in the world.</p>\n<p>æ´Ž Gumena hunting fish sails.</p>",id:"/home/swain/workspace/political-life/src/pages/en/0126.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/en/0126.md",frontmatter:{title:"Wednesday, July 27"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/en/0126.md absPath of file >>> MarkdownRemark"}}}});
